import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Stack from "@mui/material/Stack";
import Button, { ButtonProps } from "@mui/material/Button";
import FormGroup from "@mui/material/FormGroup";
import { styled, alpha } from "@mui/material/styles";
import InputBase from "@mui/material/InputBase";

// MUI Button Styles
const ColorButton = styled(Button)<ButtonProps>(({ theme }) => ({
  color: theme.palette.getContrastText("#2F49D1"),
  backgroundColor: "#2F49D1",
  "&:hover": {
    backgroundColor: "#2F49D1",
  },
  textTransform: "none",
}));
const BootstrapInput = styled(InputBase)(({ theme }) => ({
  "label + &": {
    marginTop: theme.spacing(3),
  },
  "& .MuiInputBase-input": {
    borderRadius: 4,
    position: "relative",
    backgroundColor: theme.palette.mode === "light" ? "#fcfcfb" : "#2b2b2b",
    border: "1px solid #ced4da",
    fontSize: 16,
    width: "auto",
    padding: "10px 12px",
    transition: theme.transitions.create([
      "border-color",
      "background-color",
      "box-shadow",
    ]),
    // Use the system font instead of the default Roboto font.
    fontFamily: [
      "-apple-system",
      "BlinkMacSystemFont",
      '"Segoe UI"',
      "Roboto",
      '"Helvetica Neue"',
      "Arial",
      "sans-serif",
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(","),
    "&:focus": {
      boxShadow: `${alpha(theme.palette.primary.main, 0.25)} 0 0 0 0.2rem`,
      borderColor: theme.palette.primary.main,
    },
  },
}));

export default function Login() {
  return (
    <section className="c-login">
      <div className="c-login__card">
        <FormGroup>
          <Box
            component="form"
            sx={{
              "& > :not(style)": { m: 1, width: "45ch" },
            }}
            noValidate
            autoComplete="off"
            className="c-login__card__form"
          >
            <label className="c-login__card__form__input">
              <span>Username</span>

              <BootstrapInput
                id="outlined-basic"
                variant="outlined"
                placeholder="Enter your username"
              />
            </label>
            <label className="c-login__card__form__input">
              <span>Password</span>

              <TextField variant="outlined" placeholder="Enter your password" />
            </label>

            <span>Forgot your password?</span>
            <label className="c-login__card__form__checkbox">
              <input type="checkbox" />
              <span className="c-login__card__form__checkbox__label">
                Remember me next time
              </span>
            </label>
            <Stack direction="column">
              <ColorButton variant="contained">Sign In</ColorButton>
            </Stack>
          </Box>
        </FormGroup>
      </div>
    </section>
  );
}
